import logo from "./logo.svg";
import "./App.css";

class Wrapper extends Component {
  render() {
    return;
    <div>
      <h1>Hello</h1>
    </div>;
  }
}

class PorfolioItem extends Component {
  render() {
    return <div />;
  }
}

export default App;
